import React, { Component } from 'react';
import './App.css';

class App extends Component {
  data=[];
  componentDidMount(){
    const apiUrl = 'https://sometimes-maybe-flaky-api.gdshive.io/';
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => {this.data=data;
      console.log(this.data)});

  }
  render(){
    return (
        <div className="App">
          <p>{data}</p>
        </div>
    );
  }
}

export default App;
